    return (
        <div className="tarefa">
            <input type="checkbox" id="checkbox" /> &nbsp;
            <input type="text" id="titulo" placeholder="Levar o Rex para passear"/> &nbsp;
            <input type="text" id="descricao" placeholder="Rex está muito estressado: passear pode acalmá-lo."/> &nbsp;
            
            <span className="material-icons">delete_forever</span>
        </div>
    );
}
